import React, { Component } from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import { Button, Row, Container, FormGroup, Input, Form } from "reactstrap";

class Body extends Component {
  render() {
    return (
      <Container>
        <br></br>
        <br></br>
        <Form inline>
          <FormGroup>
            <Input
              name="search"
              id="exampleEmail"
              placeholder="Cari..."
              style={{ width: "100%" }}
            />
          </FormGroup>
          <Button>Cari</Button>
        </Form>
        <br></br>
        <br></br>
        <h1 style={{ textAlign: "left" }}>Category</h1>
        <br></br>
        <Row className="justify-content-between">
          <Button size="lg">Sport</Button>
          <Button size="lg">Music</Button>
          <Button size="lg">Science</Button>
          <Button size="lg">Programming</Button>
        </Row>
      </Container>
    );
  }
}

export default Body;
